import logo from '../../assets/logo.svg';
import { Container } from './styles';

interface Props {
    openModal: () => void; 
}

export const Header = ({ open }: Props) => {

    return (      
        <Container>
            <div>
                <img src={ logo } alt="RZ Money" />
                <button onClick  type='button'>New Transaction</button>
            </div>
        </Container>
    );
}
